const fetch = require('node-fetch')
const fs = require('fs')

class InferenceSession {
  constructor(sessionId = "11/29/2022,1669731158519-190985090") {
    this.sessionId = sessionId;
    this.masked_segmap_b64 =  ''
    this.masked_edgemap_b64 = ''
    this.masked_image_b64 =   ''
    this.image_data_prefix = 'data:image/png;base64,'
    this.infer_body = 
    `\
name=${encodeURIComponent(this.sessionId)}\
&masked_segmap=${encodeURIComponent(this.image_data_prefix)}\
${encodeURIComponent(this.masked_segmap_b64)}\
&masked_edgemap=${encodeURIComponent(this.image_data_prefix)}\
${encodeURIComponent(this.masked_edgemap_b64)}\
&masked_image=${encodeURIComponent(this.image_data_prefix)}\
${encodeURIComponent(this.masked_image_b64)}\
&style_name=random\
&caption=\
&enable_seg=true\
&enable_edge=false\
&enable_caption=false\
&enable_image=false\
&use_model2=false\
`

    this.receive_body=
`------WebKitFormBoundaryjq68f6wHEgmrzYgL\r\n\
Content-Disposition: form-data; name=\"name\"\r\n\
\r\n\
${this.sessionId}\r\n\
------WebKitFormBoundaryjq68f6wHEgmrzYgL--\r\n\
`
    this.res
  }
  async infer() {
    this.res = await infer(this.infer_body)
    if (!this.res.status == 200) {console.error(this.res); return false}
    this.res = receive(this.receive_body)
    if (!this.res.status == 200) {console.error(this.res); return false}
    return this.res
  }
}

let infer = async (body)=> {
  console.log(body)
  return await fetch("http://ec2-54-184-13-84.us-west-2.compute.amazonaws.com:443/gaugan2_infer", {
      "headers": {
        "accept": "*/*",
        "accept-language": "en-US,en;q=0.9",
        "cache-control": "no-cache",
        "content-type": "application/x-www-form-urlencoded; charset=UTF-8",
        "pragma": "no-cache",
        "Referer": "http://gaugan.org/",
        "Referrer-Policy": "strict-origin-when-cross-origin"
      },
      "body": body,
      "method": "POST"
    });}

let receive = async (body)=> {
  console.log(body)
  return await fetch("http://ec2-54-184-13-84.us-west-2.compute.amazonaws.com:443/gaugan2_receive_output", {
      "headers": {
        "accept": "*/*",
        "accept-language": "en-US,en;q=0.9",
        "cache-control": "no-cache",
        "content-type": "multipart/form-data; boundary=----WebKitFormBoundaryjq68f6wHEgmrzYgL",
        "pragma": "no-cache",
        "Referer": "http://gaugan.org/",
        "Referrer-Policy": "strict-origin-when-cross-origin"
      },
      "body": body,
      "method": "POST"
    });}

(async ()=> {
    // let res_infer = await infer()
    // let res_receive = await receive()
    let is = new InferenceSession()
    let res = await is.infer()
    let blob = await res.blob()
    let abuff = await blob.arrayBuffer();
    let uarr=new Uint8Array(abuff)
    let buff = Buffer.from(uarr)
    await fs.writeFileSync('out.jpg',buff)
})()

